he first modern platform that has lived up to its promise of lowering our developer costs.</p>'),(326,66,'_wp_old_date','2022-03-11'),(327,65,'testimonialAuthor','Jason Wiegman'),(328,65,'_wp_old_slug','65'),(329,65,'testimonialContent','<p>We were skeptical about Faust.js at first as we weren\'t sure WordPress could make a solid backend for a modern website. We were wrong. Faust.js and Atlas let us build exactly what we needed with modern tooling unencumbered by any WordPress or other limitations.</p>'),(330,65,'_wp_old_date','2022-03-11'),(331,64,'testimonialAuthor','Blake Konen'),(332,64,'_wp_old_slug','64'),(333,64,'testimonialContent','<p>Atlas helped us launch our site far quicker than anything else we tried and our marketing team loved that we were able to keep WordPress for them to continue to edit the content.</p>'),(334,64,'_wp_old_date','2022-03-11'),(335,206,'_edit_lock','1658909357:1');
